window.bookSummaryJSON = "<p><b>Hunted, confused, pissed off…this is one quarry you don’t want to back into a corner.</b></p> <p>Steve and Ingrid have escaped the clutches of Athena, but Steve is still learning, both about his place in the world, and his capabilities...not to mention those of the creatures that surround him.</p> <p>Ingrid, too, must find her way in the new reality she finds her world has become, and the pair need a plan.</p> <p>Fortunately, Ingrid’s a lot brighter than Steve, and she’s had plenty of time to plan, to observe, and to build up a festering hatred of her \"betters\".</p> <p>Steve’s going recruiting—<i>and harvesting. </i>Greece is in for a hell of a surprise, and for the criminal element out there? It’ll be a fatal one…</p>"; 
